// src/FondeoTracker.js
import React, { useState, useEffect } from "react";

export default function FondeoTracker({ balance, risk, onBack }) {
  const [trades, setTrades] = useState(() => {
    const saved = localStorage.getItem("trades");
    return saved ? JSON.parse(saved) : [];
  });

  const [form, setForm] = useState({
    result: "",
    emotion: "",
    comment: "",
  });

  const maxDailyTrades = 5;

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const addTrade = () => {
    if (!form.result || !form.emotion) return alert("Completa todos los campos.");

    const newTrade = {
      ...form,
      date: new Date().toLocaleString(),
    };

    const updated = [...trades, newTrade];
    setTrades(updated);
    localStorage.setItem("trades", JSON.stringify(updated));
    setForm({ result: "", emotion: "", comment: "" });
  };

  const totalPnL = trades.reduce((acc, t) => acc + parseFloat(t.result || 0), 0).toFixed(2);

  return (
    <div className="min-h-screen bg-gradient-to-br from-indigo-50 to-blue-100 p-6">
      <button onClick={onBack} className="mb-4 text-indigo-700 underline">
        ← Volver al Dashboard
      </button>

      <h2 className="text-2xl font-bold text-indigo-800 mb-4">📒 Registro de Trades</h2>

      <div className="bg-white shadow-md rounded-xl p-5 mb-6">
        <div className="grid grid-cols-1 sm:grid-cols-3 gap-4">
          <input
            type="number"
            name="result"
            value={form.result}
            onChange={handleChange}
            placeholder="Resultado del trade ($)"
            className="p-2 border rounded"
          />
          <select
            name="emotion"
            value={form.emotion}
            onChange={handleChange}
            className="p-2 border rounded"
          >
            <option value="">Cómo te sentiste</option>
            <option value="calmo">😌 Calmo</option>
            <option value="ansioso">😰 Ansioso</option>
            <option value="frustrado">😤 Frustrado</option>
            <option value="confiado">💪 Confiado</option>
          </select>
          <input
            type="text"
            name="comment"
            value={form.comment}
            onChange={handleChange}
            placeholder="Comentario (opcional)"
            className="p-2 border rounded"
          />
        </div>
        <button
          onClick={addTrade}
          className="mt-4 px-4 py-2 bg-indigo-600 text-white rounded hover:bg-indigo-700"
          disabled={trades.length >= maxDailyTrades}
        >
          Agregar Trade
        </button>
        {trades.length >= maxDailyTrades && (
          <p className="text-red-600 mt-2">🚫 Límite diario de trades alcanzado.</p>
        )}
      </div>

      <div className="bg-white p-4 rounded shadow-md">
        <h3 className="text-xl font-semibold text-indigo-700 mb-2">📈 Resumen</h3>
        <p><strong>Total PnL:</strong> ${totalPnL}</p>
        <p><strong>Trades realizados:</strong> {trades.length}/{maxDailyTrades}</p>
      </div>

      <div className="mt-6">
        <h4 className="text-lg font-semibold text-indigo-600 mb-2">🧾 Historial</h4>
        <ul className="space-y-2">
          {trades.map((t, i) => (
            <li key={i} className="bg-indigo-50 p-3 rounded border">
              <p><strong>{t.date}</strong></p>
              <p>Resultado: ${t.result} | Emoción: {t.emotion}</p>
              {t.comment && <p>Comentario: {t.comment}</p>}
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
}
